    [],nt"revision_timestamp": "2016-02-26T22:16:44.120634",nt"name": "macro-algae-biomass-and-cover-from-nearshore-regions-of-the-nantorium-war-memorial-waikiki",nt"isopen":
    false,nt"url": null,nt"notes": "The Department of Zoology, University of
    Hawaii at Manoa, incorporated surveys of macro-algae as part of the Zoology 439L
    "Laboratory in Ecology" during annual field experiments 1970-2005. Macro-algae
    species were identified and biomass and percent substrate cover were quantified
    using a 200m transect extending seaward from Natatorium Wall sampling at 10m intervals.
    Coral species and cover also recorded. Miscellaneous substrate types such as sand
    or rubble were also noted. The data set is extended back to 1966 with digitized
    data from M.S. Doty (1969). Water quality measurements are provided by the State
    of Hawaii, Department of Health (already in NODC Accession 0013724) over 1973-1992
    and the Waikiki Aquarium from 1999-2005.",nt"license_title": "License Not
